import React, { useEffect, useState } from 'react';
import Style from '../Openings/Openings.module.css';
import { Heading } from '../Heading/Heading';

export const Openings = () => {
  const [openingsJson, setOpeningsJson] = useState([]);
  const [selectedOpeningIndex, setSelectedOpeningIndex] = useState(null);
  const [selectedTestIndex, setSelectedTestIndex] = useState(null);
  const [viewDetails, setViewDetails] = useState(false);
  const [show, setShow] = useState(false);

  const fetchCallForOpenings = () => {
    fetch("http://localhost:8080/JobVista/GetOpenings", {
      method: 'GET',
      headers: {
        'Content-type': 'Application/JSON'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        setOpeningsJson(result.Value);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  useEffect(() => {
    fetchCallForOpenings();
  }, []);

  return (
    <div>
      {!viewDetails && openingsJson && (
        <div id={Style.applicants}>
          <Heading>Openings</Heading>
          <table>
            <thead>
              <tr className={Style.openingTr}>
                <th>Opening Name</th>
                <th>Qualification</th>
                <th>Experience</th>
                <th>Employment Type</th>
                <th>Salary Range</th>
                <th>Start Date</th>
                <th>End Date</th>
                <th>Department Name</th>
              </tr>
            </thead>
            <tbody>
              {openingsJson.map((item, index) => (
                <tr key={index} onClick={() => {
                  setSelectedOpeningIndex(index);
                  setViewDetails(true);
                }}>
                  <td>{item.Opening.description}</td>
                  <td>{item.Opening.qualification}</td>
                  <td>{item.Opening.experience}</td>
                  <td>{item.Opening.employmentType}</td>
                  <td>{item.Opening.salaryRange}</td>
                  <td>{item.Opening.startDate}</td>
                  <td>{item.Opening.endDate}</td>
                  <td>{item.Opening.departments}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
      {viewDetails && selectedOpeningIndex !== null && (
        <div id={Style.openingId}>
          <div className={Style.applicantDiv}>
            <Heading className={Style.title}>
              <i onClick={() => setViewDetails(false)} className="fa-regular fa-circle-left"></i>Tests
            </Heading>
          <table>
            <thead>
              <tr className={Style.openingTr}>
                <th>Test Title</th>
                <th>Date</th>
                <th>Duration</th>
              </tr>
            </thead>
            <tbody>
              {openingsJson[selectedOpeningIndex].Test && Object.keys(openingsJson[selectedOpeningIndex].Test).length > 0 ? (
                <tr >
                  <td>{openingsJson[selectedOpeningIndex].Test.testTitle}</td>
                  <td>{openingsJson[selectedOpeningIndex].Test.testDate}</td>
                  <td>{openingsJson[selectedOpeningIndex].Test.testDuration}</td>
                </tr>
              ) : (
                <tr>
                  <td colSpan="3">No tests available</td>
                </tr>
              )}
            </tbody>
          </table>
          </div>
          <div className={Style.applicantDiv}>
            <Heading className={Style.title}>
              Panelists
            </Heading>
          <table>
            <thead>
              <tr className={Style.openingTr}>
                <th>Name</th>
                <th>Email</th>
                <th>Position</th>
                <th>Gender</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{openingsJson[selectedOpeningIndex].Panelist.panelistName}</td>
                <td>{openingsJson[selectedOpeningIndex].Panelist.panelistEmail}</td>
                <td>{openingsJson[selectedOpeningIndex].Panelist.panelistPosition}</td>
                <td>{openingsJson[selectedOpeningIndex].Panelist.panelistGender}</td>
              </tr>
            </tbody>
          </table>
          </div>
        </div>
      )}

{viewDetails && selectedOpeningIndex !== null && (
  <div>
    <div id={Style.applicantDiv}>
      <Heading className={Style.title}>
        <i onClick={() => setViewDetails(false)} className="fa-regular fa-circle-left"></i>Applicants
      </Heading>
    </div>
    <table>
      <thead>
        <tr className={Style.openingTr}>
          <th>Name</th>
          <th>Email</th>
          <th>Gender</th>
          <th>DOB</th>
          <th>Qualification</th>
          <th>Phone</th>
          <th>Experience</th>
          <th>Application Id</th>
        </tr>
      </thead>
      <tbody>
      {openingsJson[selectedOpeningIndex].Applicants.length > 0 ? (
  openingsJson[selectedOpeningIndex].Applicants[0].map((applicant, index) => (
    <tr key={index}>
      <td>{applicant.jobSeekerName}</td>
      <td>{applicant.jobSeekerEmail}</td>
      <td>{applicant.jobSeekerGender}</td>
      <td>{applicant.jobSeekerDOB}</td>
      <td>{applicant.jobSeekerQualification}</td>
      <td>{applicant.jobSeekerPhone}</td>
      <td>{applicant.jobSeekerExperience}</td>
      <td>{applicant.applicationId}</td>
    </tr>
  ))
) : (
  <tr>
    <td colSpan="8">No applicants</td>
  </tr>
)}

      </tbody>
    </table>
  </div>
)}

    </div>
  );
}
